import React from 'react';
import './Modal.css';

const Modal = (props) => (
  <div className="modal-container">
    <h3>{props.header}</h3>
    <p>{props.para}</p>
    <div>
      <p>{props.btnTxt}</p>
    </div>
  </div>
);

export default Modal;
